import React from "react";
import Header from "./includes/Header";
import Spotlight from "./screens/Spotlight";

export default function LandingPage() {
    return (
        <>
            <Router>
                <Routes>
                    <Route path="/" element={<Header />} />
                    <Route path="/exp" element={<Spotlight />} />
                </Routes>
            </Router>
        </>
    );
}
